import React from 'react'
import Person from '../models/person'
import People from './People'

const PeopleList: React.FC<{ people: Person[]; onDeletePerson :(name:string)=>void}> = ({
	people,
}) => {
	console.log(people)
	return (
		<div>
			<h1>PeopleList</h1>
			<ul>
				{people.map((person: Person) => (
					<People person={person} key={person.name} onDeletePerson={onDeletePerson} />
				))}
			</ul>
		</div>
	)
}

export default PeopleList

